import styled from "styled-components";

export const Button = styled.button`
    background-color: ${(props) =>
        props.outlined ? "transparent" : "#ff4500"};
    border: 1px solid ${(props) => (props.outlined ? "#f0f8ff" : "#ff4500")};
    color: #f0f8ff;

        margin-top:; 30px
    border-radius: 5px;
    padding: 5px 20px;
    font-weight: 500;
    letter-spacing: 1px;
`;
